// export default renderDeviceIndexMenu

import IndexMenu from "./indexMenu";

const renderDeviceIndexMenu = (deviceDisplay, filteredDeviceSearch, deviceRelevantSearch, index) => {
  console.log(index)
  if (deviceDisplay) {
    if (filteredDeviceSearch.length === 0) return <div></div>

    return <IndexMenu
      relevantSearch={deviceRelevantSearch} 
      index1={index[0]} 
      index2={index[1]} 
      index3={index[2]} 
      index4={index[3]} 
      index5={index[4]}
      index6={index[5]}
    />
  }
}

export default renderDeviceIndexMenu
